// import { useState } from 'react';
import './App.css';

function App() {

  const onSubmitHandler = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://127.0.0.1:5000/test', {
        method: 'GET',
      })
      const data = await response.json();
      console.log(data);

    } catch (error) {
      console.log(error);
    }
  }

  return (
    <div className="App">
      <button 
        className="button"
        onClick={onSubmitHandler}
      >
        Get Recommendations!
      </button>
    </div>
  );
}

export default App;
